import React from 'react';
import '../App.css';
import SearchForm from './SearchForm';
import Stations from './Stations'

const cu  =[
  {id: 1, name:'Krakow'},
  {id: 2, name:'dupa'}
];

function MainPollination() {

  return (
    <div>
      <SearchForm />
        <Stations station = {cu}/>
      </div>
  );
}
export default MainPollination;
